import React from 'react';
import { useParams } from 'react-router-dom';
import Level1 from './Level1'; // import các cấp độ khác nếu có

const Level = () => {
    const { levelId } = useParams();

    switch (levelId) {
        case '1':
            return <Level1 />;
        // case '2':
        //     return <Level2 />; // Thêm nếu có
        // case '3':
        //     return <Level3 />; // Thêm nếu có
        default:
            return <div>Level không hợp lệ.</div>;
    }
};

export default Level;
